import "bootstrap/dist/css/bootstrap.min.css";
import styled from "styled-components";

import { Button, Navbar, Container, Nav, Row, Col } from "react-bootstrap";

import Appbars from "./components/appbars.js";
import Searchbox from "./components/searchbox.js";
import Musiccontroller from "./components/musiccontroller.js";
import Feedswrap from "./components/feedswrap.js";

import Login from "./route/login.js";
import Register from "./route/register.js";

let CenterBox = styled.div`
  text-align: center;
`;

let MainWrap = styled.div`
  // max-width: 1300px;
  margin: auto;
  background: #00457e;
  padding: 1rem;
`;

let LoginBtn = styled.button`
  text-align: center;
  color: white;
  border-radius: 1rem;
  padding: 0.8rem;
  background: #2f70af;
  float: left;
  font-size: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
  border: none;
`;

let PlayerBox = styled.div`
  border-radius: 1rem;
  background: #b9848c;
  color: white;
  padding: 0.5rem;
  margin-top: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let LoginBox = styled.div`
  background: #02315e;
  border-radius: 1rem;
  padding: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
  float: right;
  color: white;
  margin-top: 1rem;
`;
let InputBox = styled.div`
  background: white;
  color: black;
  margin: 0.2rem;
  width: 10rem;
`;

function App() {
  return (
    <>
      <Appbars></Appbars>
      <MainWrap className="App">
        <LoginBox>
          로그인<InputBox>아이디</InputBox>
          <InputBox>비밀번호</InputBox>
        </LoginBox>
        <CenterBox>
          <Searchbox></Searchbox>
        </CenterBox>
        <Feedswrap></Feedswrap>

        <PlayerBox>
          <Musiccontroller></Musiccontroller>
        </PlayerBox>
      </MainWrap>
      <Login></Login>
      <Register></Register>
    </>
  );
}

export default App;
